import React from "react";
import Header from "../../Header/Header";
import Slidetop from "../../Slidetop/Slidetop";
import Footer from "../../Footer/Foter";

const Coursepage = () => {
  return (
    <div>
      <Header />
      <Slidetop />
      <div className="detai-course">
        <div className="detail-desc">
          Scratch là ngôn ngữ lập trình trẻ em phổ biến nhất thế giới, phát
          triển bởi học viện MIT, Mỹ. Trẻ em tại nhiều quốc gia bắt đầu học lập
          trình từ 5 tuổi
        </div>
        <div className="details-what-learn">
          <h3 className="what-learn"></h3>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Coursepage;
